import styled from "@emotion/styled";
import { Button } from "@mui/material";

export const StyledIconButton = styled(Button)(({ theme }) => ({
  color: theme.palette.primary,
  backgroundColor: theme.palette.secondary,
  "&:hover": {
    backgroundColor: theme.palette.secondary,
    color: theme.palette.primary,
  },
}));
